import logo from './logo.svg';
import './App.css';
import { useEffect, useState } from "react";
import axios from "axios";

function App() {

	const [data, setData] = useState();

	useEffect(() => {
		axios.get('/api')
		.then(({ data }) => {
			setData(data);
		});
	}, []);
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
			<p>
				{!data ? "Loading" : ""}
			</p>
      </header>
    </div>
  );
}

export default App;
